import React from 'react';
import './App.css';

import Card from '@material-ui/core/Card';

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

class MomentCard extends React.Component {
    state = {
        active: false
    }



    render() {
        if (this.state.active) {
            return (
                <div></div>
            )
        }

        return (
            <Card>
                <p>This is where my MomentCard is going to be</p>
            </Card>
        )
    }
}

export default MomentCard;
